import React, { Component } from "react";
import "./App.css";
import Navbar from "./components/layout/Navbar";

import Footer from "./components/layout/Footer";

class App extends Component {
  render() {
    return (
      <div>
        <Navbar />
        <Footer />
      </div>
    );
  }
}

export default App;
